import React from "react";
import ReactDOM  from "react-dom";
import { responsive } from "./responsive.js";
import cppimg from './cpp.png'
import javaimg from './java.png'
import reactimg from './react.png'
let arr=[['C++',cppimg,0],['Java',javaimg,1],['React',reactimg,2]]
export class Explore_header extends React.Component{
    constructor(){
        super()
        this.state={style:responsive.explore.Main()}
        this.resize=this.resize.bind(this)
        window.addEventListener('resize',this.resize)
    }
    resize(){
        this.setState({style:responsive.explore.Main()})
    }
    render(){
        return (
            <div style={this.state.style}>
                Explore More...
                {arr.map((ele)=><Explore img={ele[1]} h1={ele[0]}/>)}
            </div>
        )
    }
}
class Explore extends React.Component{
    constructor(props){
        super(props)
        this.state={style:responsive.explore.Element(),image:responsive.explore.image(this.props.img)};
    }
    resize(){
        this.setState({style:responsive.explore.Element(),image:responsive.explore.image(this.props.img)})
    }
    render(){
        return(
            <div>
                <div style={this.state.image}>
                </div>
                <h1>
                    {this.props.h1}
                </h1>
            </div>
        )
    }
}
